import React from 'react';
import './App.css';
import Appbar from './components/Appbar'
import User from './components/User';
import Home from './components/Home';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
      <Appbar/>
        <Switch>
          <Route path="/create">
            <User/>
          </Route>
          <Route path="/home">
            <Home />
          </Route>
        </Switch>
      </div>
    </Router>
  );
}

export default App;
